&lt;p&gt;
	Develop and apply promising quantitative pass/fail criteria to CPV using acoustic emission (AE) and lay the foundation for continued development of an automated structural health monitoring (SHM) .&amp;nbsp; CPV will be tested (current funding supports two) and several additional strand tests (a portion of 380 remaining specimens provided by NNWG) are needed to provide a statistical basis to promising test results. The project: An experienced NMSG Grad student is performing modal waveform frequency analysis to identify progressive damage and by COTs and custom software (e.g., WSTF/GRC Acoustic Emission Analysis Applet and WSTF FRAT).&amp;nbsp; Utilizes new AE equipment and labor from separately funded NASA interns for more productivity.&lt;/p&gt;
&lt;p&gt;
	FY13 Hardware and Software Progress&lt;/p&gt;
&lt;ul&gt;
	&lt;li&gt;
		Identified NI and AE vendor components for a proof of concept system&lt;/li&gt;
	&lt;li&gt;
		Proof of concept hardware has been procured and is currently capable of viewing AE data on 8 individual channels&lt;/li&gt;
	&lt;li&gt;
		A combination of a Digital Wave FM-1 signal conditioner and B-1025 AE sensors are used&amp;nbsp; in conjunction with a NI PXI system to collect data&lt;/li&gt;
	&lt;li&gt;
		NI LabView is used to view AE data but is currently not capable of recording multiple waveforms&lt;/li&gt;
	&lt;li&gt;
		Development of program capable of recording all waveforms is currently under development&lt;/li&gt;
	&lt;li&gt;
		Software is still not capable of recording parametric data but hardware is now in the PXI system to do so&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;
	&amp;nbsp;&lt;/p&gt;
